import React from 'react';
import styled from 'styled-components';
import Logo from '../header/Logo.js';

import {
  Switch,
  Route,
  Link,
} from 'react-router-dom';

const LoginPageS = styled.div`
  position: fixed;
  display: flex;
  flex-wrap: wrap;

  width: 30%;
  height: 40%;
  margin-top: 15%;
  margin-left: 35%;
  display: flex;
  justify-content: center;
  background: plum;
`;

const UnderLineS = styled.div`
  border-bottom: dashed;
  width: 75%;
  height: 0px;
  margin-top: ${(props) => props.margintop};
`;

const BlockS = styled.input`
  width: 50%;
  height: 10%;
  border: 2px solid #bbb;
  border-radius: 6px;
  font-size: 16px;
  text-align: center;
  margin-top: ${(props) => props.margintop};
  margin-left: ${(props) => props.marginleft};
`;

const ButtonS = styled.button`
  width: 20%;
  height: 30%;
  border: 2px solid #bbb;
  border-radius: 6px;
  font-size: 16px;
  text-align: center;
  margin-top: ${(props) => props.margintop};
`;

function Loginpage({ children }) {

  return <LoginPageS>
      <Logo>60px</Logo>
      <UnderLineS margintop='-50px'></UnderLineS>
      <BlockS placeholder='ID' margintop='-100px'></BlockS>
      <ButtonS margintop='-115px'>로그인</ButtonS>
      <BlockS placeholder='Password' margintop='-130px' marginleft='-20%'></BlockS>
    </LoginPageS>
}

export default Loginpage;
